import './App.css';
import React from "react";
import { AppBar, Container, Tab, Tabs } from '@material-ui/core';
import HomePageComponent from './components/HomePageComponent';

class App extends React.Component {

  constructor(props){
    super(props)
    this.setState({
      value: 0,
      setValue: 0
    })
  }

  componentDidMount(){
    this.setState({ value: 0, setValue: 0})
  }

  handleChange = (event, newValue) => {
    if(newValue !== null){
      this.setState({ setValue: newValue});
    }
  };

  render(){

  return (
    <Container>
      <AppBar position="static">
        <Tabs
          indicatorColor="primary"
          textColor="primary"
          centered
          onChange={this.handleChange} 
          >
              <Tab label="Home">
                {this.state.setValue !== undefined && this.state.setValue === 0 &&
                  <HomePageComponent/>
                }
              </Tab>
              <Tab label="SinglePage" >
              </Tab>
        </Tabs>
    </AppBar>
     {/*<BrowserRouter>
